import './App.css';
import {BrowserRouter,Route,route,Switch} from 'react-router-dom'
import LandingPage from './components/LandingPage'
import Home from './components/Home';

function App() {

  return (
    <BrowserRouter>
    <div className="App">
      <Switch>
        <Route exact path='/' component={LandingPage}></Route>
        <Route exact path='/pokemons' component={Home}></Route>

      </Switch>
      <h1>Front-end Pokemon</h1>
      <div className="text">
  <p>Ash, Dawn y Brock continúan sus viajes por la región                                                                          
      de Sinnoh, enfrentando nuevos desafíos y conociendo a más Pokémon.</p>
</div>
    </div>
    </BrowserRouter>
  );
}                                                                                                                                                                                                                                                                                                                                                                                          

export default App;
